"use strict";(self.webpackChunkpaulohernane_me=self.webpackChunkpaulohernane_me||[]).push([[8130],{7735:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"dev-log-2","metadata":{"permalink":"/blog/dev-log-2","source":"@site/blog/2025-05-18-dev-log-2.md","title":"Dev Log 2","description":"Enfim domingo, essa semana foi doidera, foquei mais nas coisas do Lacina, Takeode e meu TCC, acabei n\xe3o tendo tempo para trabalhar no meu Homelab.","date":"2025-05-18T00:00:00.000Z","tags":[{"inline":true,"label":"code","permalink":"/blog/tags/code"},{"inline":true,"label":"programming","permalink":"/blog/tags/programming"},{"inline":true,"label":"routine","permalink":"/blog/tags/routine"},{"inline":true,"label":"dev-log","permalink":"/blog/tags/dev-log"}],"readingTime":1.675,"hasTruncateMarker":true,"authors":[{"name":"Paulo Hernane","title":"Software Engineer, Co-founder and CTO @ Takeode","url":"https://github.com/PauloHFS","page":{"permalink":"/blog/authors/paulohfs"},"socials":{"x":"https://x.com/paulo_hfs","github":"https://github.com/PauloHFS","linkedin":"https://www.linkedin.com/in/paulohernane/","newsletter":"https://paulohfs.github.io/blog"},"imageURL":"https://github.com/PauloHFS.png","key":"paulohfs"}],"frontMatter":{"slug":"dev-log-2","title":"Dev Log 2","authors":"paulohfs","tags":["code","programming","routine","dev-log"]},"unlisted":false,"nextItem":{"title":"Dev Log 1","permalink":"/blog/dev-log-1"}},"content":"Enfim domingo, essa semana foi doidera, foquei mais nas coisas do Lacina, Takeode e meu TCC, acabei n\xe3o tendo tempo para trabalhar no meu Homelab.\\n\\n### \ud83e\uddea LACINA\\n\\nEssa semana eu fiquei validando a implementa\xe7\xe3o que fiz semana passada em manipular Parquets com o PySpark, descobri alguns problemas que ainda n\xe3o deu para executar a fun\xe7\xe3o no PySpark que eu escrevi, mas na quinta eu j\xe1 descobri qual foi problema e nessa proxima semana eu j\xe1 vou conseguir corrigir para continuar testando.\\n\x3c!-- truncate --\x3e\\n\\nAprendi cada vez mais sobre o PySpark, acho que preciso tirar um tempo para focar apenas nele.\\n\\nMais uma vez, estou trabado nessa atividade de transposi\xe7\xe3o de dados, mas j\xe1 estou quase l\xe1. Preciso corrigir o c\xf3digo que escrevi e validar a execu\xe7\xe3o.\\n\\nAcho que essa semana foi proveitosa, consegui aprender bem mais sobre os fluxos na nossa aplica\xe7\xe3o enquanto debugava o c\xf3digo.\\n\\n---\\n\\n### \ud83d\ude80 Takeode\\n\\nEssa semana eu tirei para criar uma nova codebase para um dos nosso projetos, o que nos levou para S\xe3o Paulo na Campus Mobile. Subi um reposit\xf3rio novo com Expo + Supabase, baseado num boilerplate que encontrei no Github. Depois coloquei as rotas da aplica\xe7\xe3o antiga e configurei o ambiente local do Supabase. As coisas est\xe3o rodando, mas ainda precisa de bastante refatora\xe7\xe3o\\n\\n---\\n\\n### \ud83d\udee0\ufe0f Projetos Pessoais\\n\\nEssa semana eu n\xe3o consegui trabalhar nos meu projetos pessoais fora o TCC. No TCC eu fiz algumas melhorias que meu orientado pediu depois de testar a v0 do projeto. Passei ent\xe3o meu tempo livre para fazer essas melhorias e testar o projeto. Creio que segunda eu v\xe1 lan\xe7ar uma v0.1 do projeto para ele voltar a testar e ver o que mais precisa ser melhorado.\\nNo meu homelab eu apenas subi o glance para colocar no lugar do meu Dashy como dashboard. Tamb\xe9m subi o emulatorjs mas n\xe3o consegui configurar para ele identificar as ROMs que coloquei, ainda vou avaliar se as ROMs que est\xe3o erradas ou o emulatorjs que n\xe3o t\xe1 configurado corretamente."},{"id":"dev-log-1","metadata":{"permalink":"/blog/dev-log-1","source":"@site/blog/2025-05-09-dev-log-1.md","title":"Dev Log 1","description":"Essa semana de foi intensa e cheia de aprendizados. Estou animado para compartilhar o que fiz, o que aprendi e o que ainda est\xe1 pendente.","date":"2025-05-09T00:00:00.000Z","tags":[{"inline":true,"label":"code","permalink":"/blog/tags/code"},{"inline":true,"label":"programming","permalink":"/blog/tags/programming"},{"inline":true,"label":"routine","permalink":"/blog/tags/routine"},{"inline":true,"label":"dev-log","permalink":"/blog/tags/dev-log"}],"readingTime":3.875,"hasTruncateMarker":true,"authors":[{"name":"Paulo Hernane","title":"Software Engineer, Co-founder and CTO @ Takeode","url":"https://github.com/PauloHFS","page":{"permalink":"/blog/authors/paulohfs"},"socials":{"x":"https://x.com/paulo_hfs","github":"https://github.com/PauloHFS","linkedin":"https://www.linkedin.com/in/paulohernane/","newsletter":"https://paulohfs.github.io/blog"},"imageURL":"https://github.com/PauloHFS.png","key":"paulohfs"}],"frontMatter":{"slug":"dev-log-1","title":"Dev Log 1","authors":"paulohfs","tags":["code","programming","routine","dev-log"]},"unlisted":false,"prevItem":{"title":"Dev Log 2","permalink":"/blog/dev-log-2"}},"content":"Essa semana de foi intensa e cheia de aprendizados. Estou animado para compartilhar o que fiz, o que aprendi e o que ainda est\xe1 pendente.\\nVamos l\xe1!\\n\\n\x3c!-- truncate --\x3e\\n\\n### \ud83e\uddea LACINA\\n\\n#### \u2705 Conclu\xeddo\\n\\n- Esta semana trabalhei realizando a implementa\xe7\xe3o de um novo recurso que permitirar os usu\xe1rios do nosso sistema de ETL realizar a Transposi\xe7\xe3o dos dados, ou seja, transformar linhas em colunas e vice-versa. Comecei pelo back end realizando a integra\xe7\xe3o do c\xf3digo C# do nosso sistema com o Python do PySpark, que \xe9 a ferramenta que utilizamos para realizar o processamento dos dados. Ainda estou com um problema para fechar esse fluxo para avaliar a execu\xe7\xe3o.\\n\\n#### \ud83d\udcd6 Aprendizado\\n\\n- Com essa implementa\xe7\xe3o, aprendi mais sobre Parquet, PySpark, Pandas, Polars e a diferen\xe7a entre eles. Tamb\xe9m aprendi mais sobre o funcionamento do nosso sistema de ETL e como ele se integra com o PySpark.\\n- Aprendi sobre processamento de dados em massa e como otimizar o desempenho do sistema.\\n\\n#### \ud83d\udccc Pend\xeancias\\n\\n- Fechar a integra\xe7\xe3o do c\xf3digo C# com o PySpark.\\n- Realizar testes de desempenho e valida\xe7\xe3o dos dados ap\xf3s a transposi\xe7\xe3o.\\n- Criar a documenta\xe7\xe3o do novo recurso.\\n- Criar o front end para o novo recurso.\\n\\n#### \ud83d\udcad Observa\xe7\xf5es\\n\\n- Sinto que demorei muito essas semana para decidir o que implementar como teste inicial, sinto que eu j\xe1 deveria est\xe1 realizando testes de desempenho e valida\xe7\xe3o dos dados. Mas como \xe9 a primeira vez que estou implementando algo assim, acabei me perdendo um pouco no meio do caminho. Ser\xe1 meu objetivo da semana que vem.\\n\\n---\\n\\n### \ud83d\ude80 Takeode\\n\\n#### \u2705 Conclu\xeddo\\n\\n- Avancei com a constru\xe7\xe3o do nosso site institucional, ainda tem muita coisa de design que a gente tem que ajustar, mas a estrutura b\xe1sica j\xe1 est\xe1 pronta. O pr\xf3ximo passo \xe9 come\xe7ar a trabalhar na parte de conte\xfado e SEO.\\n- Tamb\xe9m finalizei a integra\xe7\xe3o do nosso site com o Google Analytics e o Google Search Console, para acompanhar o desempenho do site e as m\xe9tricas de SEO. Mas ainda t\xe1 com um problema que ainda vou investigar.\\n- Dei uma avaliada em um reposit\xf3rio que \xe9 um starter de aplicativo com Expo + Supabase, que \xe9 a nossa stack de desenvolvimento. O reposit\xf3rio \xe9 bem legal e tem v\xe1rias funcionalidades que podem ser \xfateis para o nosso projeto. Vou continuar explorando ele e ver como podemos integrar no nosso projeto.\\n\\n#### \ud83d\udcd6 Aprendizado\\n\\n- Aprendi mais sobre SEO e como otimizar o site para os motores de busca. Tamb\xe9m aprendi mais sobre o Google Analytics e o Google Search Console, como configurar e acompanhar as m\xe9tricas do site.\\n\\n#### \ud83d\udccc Pend\xeancias\\n\\n- Ainda tenhos que trabalhar na finaliza\xe7\xe3o do site institucional.\\n\\n#### \ud83d\udcad Observa\xe7\xf5es\\n\\n- Acho que o site institucional vai ficar bem legal, mas ainda tem muito trabalho pela frente. Estou animado para ver como ele vai ficar quando estiver pronto.\\n- Tamb\xe9m estou animado para ver como o reposit\xf3rio do Expo + Supabase vai se integrar ao nosso projeto. Acredito que vai facilitar bastante o desenvolvimento e a manuten\xe7\xe3o do aplicativo.\\n\\n---\\n\\n### \ud83d\udee0\ufe0f Projetos Pessoais\\n\\n#### \u2705 Conclu\xeddo\\n\\n- Troquei o cooler do meu homelab, que estava muito barulhento e n\xe3o estava dando conta do calor do processador. O novo cooler \xe9 muito mais silencioso e eficiente, o que melhorou bastante o desempenho do homelab.\\n- Subi o jupyter no meu homelab e t\xf4 rodando alguns testes com ele, atualmente estou fazendo uma RAG com os chats que exportei do Whatsapp com meus amigos.\\n\\n#### \ud83d\udcd6 Aprendizado\\n\\n- Aprendi mais sobre LangChain, LLMs, Vectors databases, Ollama, Jupyter e como integrar tudo isso com o meu homelab.\\n- Aprendi mais sobre o funcionamento do meu homelab e como otimizar o desempenho dele. Tamb\xe9m aprendi mais sobre o funcionamento do cooler e como ele afeta o desempenho do processador.\\n- Aprendi a configurar o Alert do Grafana para me avisar quando a temperatura do processador passar de 80 graus, o que me ajudou a evitar problemas de superaquecimento.\\n\\n#### \ud83d\udccc Pend\xeancias\\n\\n- Ainda tenho que configurar backups autom\xe1ticos para o meu homelab, atualmente estou fazendo manualmente e n\xe3o \xe9 muito pr\xe1tico.\\n\\n#### \ud83d\udcad Observa\xe7\xf5es\\n\\n- Estou satisfeito com as melhorias que fiz no meu homelab e estou animado para continuar explorando novas tecnologias e otimiza\xe7\xf5es.\\n\\nAinda teve muitas outras coisas que fiz essa semana mas acabei n\xe3o anotando, ent\xe3o n\xe3o vou lembrar de tudo. Mas no geral foi uma semana produtiva e cheia de aprendizados. Estou animado para ver o que a pr\xf3xima semana vai trazer, vou tentar anotar mais as coisas que fiz e aprendi para compartilhar com voc\xeas."}]}}')}}]);